import React from 'react';
import { Link } from 'react-router-dom';

class Footer extends React.Component{
    render() {
        return (
            <div>
                <div className="mainContentbg">
                    <div className="text-center text-white">
                        <Link>產品資訊</Link>
                        <Link>保固服務</Link>
                        <Link>最新資訊</Link>
                        <Link>關於我們</Link>
                    </div>
                </div>
            </div>
        )
    }
}
export default Footer;
